  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Gulf Island National
  Wildlife Refuges (Petit Bois National Wildlife Refuge, Horn Island National Wildlife
  Refuge, and Breton National Wildlife Refuge) outlines Refuge accomplishments from
  May through August of 1961. The report begins by summarizing the weather conditions,
  habitat conditions, water conditions, and food and cover during this period. Wildlife-
  including migratory birds, furbearers, predators, rodents, mammals, raptors, and
  reptiles- is also covered. The Refuge development and maintenance section discusses
  physical developments and plantings. The public relations section of the report
  describes recreational uses and Refuge visitors. Items of interest, N-R forms, and
  photographs are attached.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
